import React, { Component } from "react";

export default class Child extends Component {
  render() {
    let { pName, pPrice, pCat, pKey, count } = this.props.product;

    return (
      <>
        <div className="card text-start col-md-3 " key={pKey}>
          <div className="card-body">
            <h2>{pName}</h2>
            <p>{pPrice}</p>
            <p>{pCat}</p>
            <p>{count}</p>
            <button
              onClick={() => {
                this.props.productDelete(this.props.index);
              }}
              className="btn btn-danger w-100 my-3"
            >
              Delete
            </button>
            button
          </div>
        </div>
      </>
    );
  }
}
